import React from 'react';
import './SearchImagePreview.scss';

const SearchImagePreview = () => {
    return(
        <div className="searchimageoverview__img-container">
          <img
            key={index}
            src={item.links[0].href}
            alt="searchimage"
            className="searchimageoverview-img"
            onClick={() => history.push(`/imagepage/${item.data[0].nasa_id}`)}
          />
          <AddTolist item={item} />
          </div>
    );
}

export default SearchImagePreview;
